  false,\n\t\"url\": null,\n\t\"notes\": \"This map layer portrays the 1980 State
  and county boundaries of the United States, Puerto Rico, and the U.S. Virgin Islands.
  The map layer was created by extracting county polygon features from the individual
  1:2,000,000-scale State boundary Digital Line Graph (DLG) files produced by the
  U.S. Geological Survey. These files were then merged into a single file and the
  boundaries were modified to what they were in 1980. This is a revised version of
  the November 2004 map layer.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
